import React, { Component } from "react";
import NavBar, { ElementsWrapper } from "react-scrolling-nav";
import { Link } from "react-scroll";

class SideBar extends Component {
  render() {
    const navbarItems = [
      {
        label: "Item 1",
        target: "item-1"
      },
      {
        label: "Item 2",
        target: "game"
      },
      {
        label: "Item 3",
        target: "item-3"
      }
    ];
    return (
      <div>
        <NavBar items={navbarItems} offset={-80} duration={500} delay={0} />
        <div className="container">
          <ElementsWrapper items={navbarItems}>
            <div name="item-1" className="item">
              //<Link to="game" spy={true} smooth={true} offset={50} duration={500}>Test</Link>
              <script src="./App.js"></script>
              item 1
            </div>
            <div name="item-2" className="item">
              test rubbish
            </div>
            <div name="item-3" className="item">
              item 3
            </div>

          </ElementsWrapper>
        </div>
      </div>
    );
  }
}

export default SideBar;
